import React from 'react';
import CSharp from '../assets/c#.png'

function Experiences() {
  return (
    <div name='skills'>
        {/* Container */}
        <div>
            <text>Experiences</text>
            <p>Following, are the technoloies I have worked with</p>
        </div>

        <div>
            <div>
                <img src={CSharp} alt="C#"/><text>C#</text>
            </div>
        </div>
    </div>
  )
}

export default Experiences
